import React from 'react';
import styles from './Header.module.scss';
import { NavLink } from 'react-router-dom';
import useAuthStore from '../../stores/authStore';

const Header = () => {
    const isLogined = useAuthStore(state => state.isLogined);
    return (
        <header className={styles.headerContainer}>
            <nav className={styles.nav}>
                <a href="/" className={styles.navItem}>Home</a>
                <a href="#about" className={styles.navItem}>About</a>
                <a href="#services" className={styles.navItem}>Services</a>
                <a href="#contact" className={styles.navItem}>Contact</a>
                <div className={styles.authButtons}>
                    {isLogined ?
                        <>
                            <NavLink to={'auth/login'}><button className={styles.button}>Login</button></NavLink>
                            <NavLink to={'auth/registration'}><button className={styles.button}>Sign Up</button></NavLink>
                        </>
                        :
                        <NavLink to={'auth/login'}><button className={styles.button}>Logout</button></NavLink>
                    }
                </div>
            </nav>

        </header>
    );
};

export default Header;
